// src/components/TopNav.jsx
import React from "react";
import { Navbar, Container, Nav, Button } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

export default function TopNav() {
  const nav = useNavigate();
  const logout = () => {
    localStorage.removeItem("deserveiq_user");
    nav("/login");
  };

  return (
    <Navbar
      expand="lg"
      className="shadow-sm"
      style={{
        background:
          "linear-gradient(90deg, #3b82f6 0%, #6366f1 50%, #8b5cf6 100%)",
        fontFamily: '"Inter", sans-serif',
      }}
    >
      <Container fluid>
        <Navbar.Brand
          onClick={() => nav("/")}
          style={{
            cursor: "pointer",
            color: "white",
            fontWeight: 700,
            fontSize: "1.3rem",
          }}
        >
          DeserveIQ
        </Navbar.Brand>

        <Nav className="ms-auto d-flex align-items-center" style={{ gap: 10 }}>
          <Nav.Link
            onClick={() => nav("/predict")}
            style={{ color: "white", fontWeight: 500 }}
          >
            Single Predict
          </Nav.Link>

          <Nav.Link
            onClick={() => nav("/batch")}
            style={{ color: "white", fontWeight: 500 }}
          >
            Batch Upload
          </Nav.Link>

          <Nav.Link
            onClick={() => nav("/students")}
            style={{ color: "white", fontWeight: 500 }}
          >
            Students
          </Nav.Link>

          <Button
            size="sm"
            onClick={logout}
            style={{
              background: "white",
              color: "#dc2626",
              fontWeight: 600,
              border: "none",
            }}
          >
            Logout
          </Button>
        </Nav>
      </Container>
    </Navbar>
  );
}
